import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import Food from './views/Food';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/creatures">
          <Food />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
